    console.log(todos)
    const todoList = todos.length ? (
        todos.map( (todo, index) => {
            let option = index;
            options = Object.assign(options, {chart: {...options.chart,id:'chart-'.concat(index)}});
            options = Object.assign(options, {title: {...options.title,text:todos[index].name}});
            console.log(index);
            console.log(option);
            return(
                /*<div className="col s6" key={index}>
                    <div className="card">
                        <AChart
