                        series={[todo]}/>
                    </div>
                </div>*/option
            );
        }
        )
    ) : (
        <p className="center">Loading</p>
    );
    return(
        <div className="container">
            <div className="row">
                {todoList}
            </div>
        </div>
    );
}
export default Seeds;
